import React from "react";
import { Outlet } from "react-router-dom";


function View() {
  return (
    <div className="flex-1 flex flex-col min-h-screen">
     

      <main className="flex-1">
        <Outlet />
      </main>

   
    </div>
  );
}

export default View;
